import React from 'react';
import anime from 'animejs';

const Anime =()=>
{
	return(
    anime({
  targets: 'div',
  translateX: [
    { value: 100, duration: 1200 },
    { value: 0, duration: 800 }
  ],
  rotate: '1turn',
  backgroundColor: '#FFF',
  duration: 2000,
  loop: true
      })


    );
}

export default Anime;
